        display: 'flex',
        alignItems: 'center',
        padding: '0 8px',
        ...theme.mixins.toolbar,
        justifyContent: 'flex-end',
    }
});

class TaskPlanner extends Component {

    constructor(props) {
        super(props);
    }

    render() {

        const {classes} = this.props;

        return (
            <div>
                <TaskPlannerDrawer/>
            </div>
        );
    }
}

export default withStyles(styles)(TaskPlanner);
